import { Component } from 'react';

class CardList extends Component {
  render() {
    console.log(this.props.nfts);
    const { nfts } = this.props;

    return (
      <div>
        {nfts.map((nft) => (
          <div className='card-container' key={nft.id}>
            <img
              alt={`nft ${nft.name}`}
              src={`https://robohash.org/${nft.id + 45}?set=set2&size=320x320`}
            />
            <h2>{nft.name}</h2>
            <p>{nft.email}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default CardList;
